ОПИСАНИЕ
Курс для детей 10-11 лет. Какими бы разными ни были дети, всех их объединяет одно: они любят игры! Мы научим их создавать свои. И поможем сделать первый шаг к востребованной профессии

Хобби, которое развивает и окрыляет:
- Изучаем программирование на практик. От базовых инструментов для создания игр в Roblox до основ скриптового языка Lua, чтобы сделать их сложнее и интереснее;
- Учитываем интересы каждого ребенка. Ребенок сам придумывает сюжет игры и дизайн персонажей. А преподаватель помогает в реализации идеи;
- Расширяем кругозор. Каждое занятие знакомимся с новыми английскими словами, терминами игровой индустрии и основами тайм-менеджментаю.

Как проходят уроки. Курс состоит из 5 модулей, и каждый из посвящен разным игровым жанрам — от простых квестов до сложных ролевых игр. Путешествуя по жанрам, ребенок изучает основные принципы создания сценариев и разработки игр.

Ребенок научится:
- Программировать головоломки, логические задачи и чат-ботов для игр;
- Продумывать интересный сюжет и персонажей и выбирать нужную игровую стратегию;
- Создавать игры на движке Roblox Studio и писать для них скрипты на языке Lua;
- Оформлять и продвигать игру на платформе Roblox и привлекать в нее новых игроков.

Выберите подходящий формат:
- Продолжительность — от полугода до года. Учеба в будни после школы или на выходных.Урок — 90 минут с перерывом
- Онлайн. Занятия из любой точки мира.Не нужно тратить время на дорогу. До 6 человек в группе.
- Офлайн.Занятия на оборудованных площадках «Алгоритмики». Живое общение с преподавателем и одногруппниками. До 12 человек в группе

Почему нам доверяют родители сотен тысяч детей по всему миру?
- Собственная игровая методика. Погружаемся в мир технологий через сюжеты о покорении космоса и работе в IT-компании;
- Проектный подход. С первых занятий применяем знания на практике;
- Обучающая платформа 3 в 1. Используем платформу как умный учебник, лабораторию для создания проектов и сообщество по интересам;
- Навыки будущего. Прокачиваем навыки, с которыми проще учиться в школе, строить планы на будущее и добиваться поставленных целей;
- Среда единомышленников. Строим планы с новыми друзьями со всего мира: создать совместный проект в Алгоритмике или свой первый IT-стартап за ее пределами

